import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './components/App';
import reportWebVitals from './reportWebVitals';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route, Router, Routes } from 'react-router-dom';
import FacturesContent from './components/Factures';
import AddReclamation from './components/AddReclamation';
import ReclamationContent from './components/Reclamation';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App/>);
<Router>
    <Routes>
              <Route exact path="/Facture" element={<FacturesContent/>}/>
              <Route exact path="/addReclamation" element={<AddReclamation/>}/>
              <Route exact path="/Reclamation" element={<ReclamationContent/>}/>
              <Route exact path="/Welcome" element={<WelcomeContent/>}/>



              </Routes>
              </Router>

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
